set lines 1000 trimspool on
set serveroutput on format wrapped
set define '&'
SET feed OFF verify off head off pages 0
prompt This script may be run as any user.
prompt It is recommended to run this script in SQL*Plus (due to the substitution var's)
prompt
prompt ================================================================================
prompt ==                         VERIFYING PREREQUISITES ...                        ==
prompt ================================================================================
prompt
WHENEVER SQLERROR EXIT SQL.sqlcode
DECLARE
 t_rec user_tables%ROWTYPE;
 NrCols number;
 NrFound number;
 RaiseError boolean := false;
 TempTs varchar2(30);
 SysPrtd BOOLEAN := FALSE;
BEGIN
 select count(*) into NrFound from all_views where owner = 'SYS' and view_name = 'PLATO$GDP$KSPPI';
 if (NrFound = 0) then
   IF (NOT SysPrtd) THEN Dbms_Output.Put_Line('-- You need to run as SYS: '); SysPrtd := TRUE; END IF;
   Dbms_Output.Put_Line('create or replace view SYS.PLATO$GDP$KSPPI AS');
   Dbms_Output.Put_Line(' SELECT a.ksppinm as parameter, a.ksppdesc as description,');
   Dbms_Output.Put_Line('        b.ksppstvl as session_value, c.ksppstvl as instance_value,');
   Dbms_Output.Put_Line('        c.ksppstdf as is_default');
   Dbms_Output.Put_Line(' FROM x$ksppi a, x$ksppcv b, x$ksppsv c');
   Dbms_Output.Put_Line(' WHERE a.indx = b.indx');
   Dbms_Output.Put_Line(' AND   a.indx = c.indx;');
   Dbms_Output.New_Line();
   IF (USER <> 'SYS') then
     Dbms_Output.Put_Line('grant select on SYS.PLATO$GDP$KSPPI to '||USER||';');
     Dbms_Output.New_Line();
   END IF;
   RaiseError := true;
 end if;
 select count(*) into NrFound from all_views where owner = 'SYS' and view_name = 'PLATO$GDP$KCCDI';
 if (NrFound = 0) then
   IF (NOT SysPrtd) THEN Dbms_Output.Put_Line('-- You need to run as SYS: '); SysPrtd := TRUE; END IF;
   Dbms_Output.Put_Line('create or replace view SYS.PLATO$GDP$KCCDI AS');
   Dbms_Output.Put_Line(' select dimlm from sys.x$kccdi;');
   Dbms_Output.New_Line();
   IF (USER <> 'SYS') then
     Dbms_Output.Put_Line('grant select on SYS.PLATO$GDP$KCCDI to '||USER||';');
     Dbms_Output.New_Line();
   END IF;
   RaiseError := true;
 end if;
 select count(*) into NrFound from user_tab_privs where owner = 'SYS' and table_name = 'DBMS_LOCK' and privilege = 'EXECUTE';
 if (NrFound = 0) then
   IF (NOT SysPrtd) THEN Dbms_Output.Put_Line('-- You need to run as SYS: '); SysPrtd := TRUE; END IF;
   Dbms_Output.Put_Line('grant execute on dbms_lock to '||USER||';');
   Dbms_Output.New_Line();
   RaiseError := true;
 end if;
 select count(*) into NrFound from user_synonyms where synonym_name = 'PLATO';
 if (NrFound = 1) then
   Dbms_Output.Put_Line('drop synonym '||USER||'.PLATO;');
   Dbms_Output.New_Line();
   RaiseError := true;
 end if;
 SELECT temporary_tablespace into TempTs FROM user_users;
 IF (TempTs = 'SYSTEM') THEN
   Dbms_Output.Put_Line('-- This script wants to create a global temporary table under the current user');
   Dbms_Output.Put_Line('-- However the temporary_tablespace of this user is SYSTEM');
   Dbms_Output.Put_Line('-- In order to avoid fragmentation in the SYSTEM tablespace, you should change ');
   Dbms_Output.Put_Line('-- the temporary tablespace of this user to something else than the SYSTEM tablespace.');
   IF (NOT SysPrtd) THEN Dbms_Output.Put_Line('-- You need to run as SYS: '); SysPrtd := TRUE; END IF;
   Dbms_Output.New_Line();
   Dbms_Output.Put_Line('set verify off define '||chr(38));
   Dbms_Output.Put_Line('accept new_temp_ts char prompt "Enter new temporary tablespace for '||USER||':" ');
   Dbms_Output.Put_Line('alter user '||USER||' temporary tablespace '||chr(38)||'new_temp_ts;');
   Dbms_Output.New_Line();
   RaiseError := true;
 END IF;
 select count(*) into NrFound from user_tables where table_name = 'PLATO$GDP_TEMP';
 if (NrFound = 0) then
   declare
    Stmt varchar2(1024);
   begin
    Stmt := 'CREATE GLOBAL TEMPORARY TABLE PLATO$GDP_TEMP
        (module varchar2(32),
        ok char(1),
        c1 varchar2(256),
        c2 varchar2(256),
        c3 varchar2(256),
        c4 varchar2(256),
        n1 NUMBER,
        n2 NUMBER,
        n3 NUMBER,
        n4 NUMBER,
        n5 number,
        n6 number,
        n7 number,
        n8 number,
        address raw(8),
        hash_value number,
        sql_id varchar2(13)
        )
        ON COMMIT DELETE rows';
    select count(*) into NrFound from session_privs where privilege in ('CREATE TABLE','CREATE ANY TABLE');
    if (NrFound = 0) then
      IF (NOT SysPrtd) THEN Dbms_Output.Put_Line('-- You need to run as SYS: '); SysPrtd := TRUE; END IF;
      Dbms_Output.Put_Line('grant create table to '||USER||';');
      Dbms_Output.New_Line();
      RaiseError := true;
    else
      execute immediate Stmt;
    end if;
   end;
 else
  SELECT * INTO t_rec FROM user_tables WHERE table_name = 'PLATO$GDP_TEMP';
  IF (t_rec.temporary = 'N' OR t_rec.duration <> 'SYS$TRANSACTION') THEN
    Dbms_Output.Put_Line('-- The existing table PLATO$GDP_TEMP cannot be used because it is');
    Dbms_Output.Put_Line('--  not a global temporary table with ''on commit delete rows''.');
    IF (NOT SysPrtd) THEN Dbms_Output.Put_Line('-- You need to run as SYS: '); SysPrtd := TRUE; END IF;
    Dbms_Output.Put_Line('drop table '||USER||'.PLATO$GDP_TEMP;');
    Dbms_Output.New_Line();
    RaiseError := true;
  END IF;
  select count(*) into NrCols from user_tab_columns
    where table_name = 'PLATO$GDP_TEMP'
    and ( (column_name in ('MODULE','C1','C2','C3','C4') and data_type = 'VARCHAR2')
          or
          (column_name in ('N1','N2','N3','N4','N5','N6','N7','N8') and data_type = 'NUMBER')
        );
  if (NrCols <> 13) then
    Dbms_Output.Put_Line('-- The existing table PLATO$GDP_TEMP cannot be used because its');
    Dbms_Output.Put_Line('-- structure is not ok. Please drop it first.');
    IF (NOT SysPrtd) THEN Dbms_Output.Put_Line('-- You need to run as SYS: '); SysPrtd := TRUE; END IF;
    Dbms_Output.Put_Line('drop table '||USER||'.PLATO$GDP_TEMP;');
    Dbms_Output.New_Line();
    RaiseError := true;
  end if;
  select count(*) into NrCols from user_tab_columns
    where table_name = 'PLATO$GDP_TEMP'
    and (column_name in ('ADDRESS') and data_type = 'RAW');
  IF (NrCols = 0) THEN
    EXECUTE IMMEDIATE 'alter table PLATO$GDP_TEMP add (address raw(8))';
  END IF;
  select count(*) into NrCols from user_tab_columns
    where table_name = 'PLATO$GDP_TEMP'
    and (column_name in ('HASH_VALUE') and data_type = 'NUMBER');
  IF (NrCols = 0) THEN
    EXECUTE IMMEDIATE 'alter table PLATO$GDP_TEMP add (hash_value number)';
  END IF;
  select count(*) into NrCols from user_tab_columns
    where table_name = 'PLATO$GDP_TEMP'
    and (column_name in ('OK') and data_type = 'CHAR');
  IF (NrCols = 0) THEN
    EXECUTE IMMEDIATE 'alter table PLATO$GDP_TEMP add (ok char(1))';
  END IF;
  select count(*) into NrCols from user_tab_columns
    where table_name = 'PLATO$GDP_TEMP'
    and (column_name in ('SQL_ID') and data_type = 'VARCHAR2');
  IF (NrCols = 0) THEN
    EXECUTE IMMEDIATE 'alter table PLATO$GDP_TEMP add (sql_id varchar2(13))';
  END IF;
 end if;
  select count(*) into NrFound from session_privs where privilege in ('CREATE PROCEDURE','CREATE ANY PROCEDURE');
  if (NrFound = 0) then
    IF (NOT SysPrtd) THEN Dbms_Output.Put_Line('-- You need to run as SYS: '); SysPrtd := TRUE; END IF;
    Dbms_Output.Put_Line('grant create procedure to '||USER||';');
    Dbms_Output.New_Line();
    RaiseError := true;
  end if;
  select count(*) into NrFound from v$version where banner like '%Release 8.%';
  if (NrFound > 0) then
    select count(*) into NrFound from session_privs where privilege in ('SELECT ANY TABLE');
    if (NrFound = 0 AND USER <> 'SYS') then
      Dbms_Output.Put_Line('-- This user requires access to a lot of data dictionary tables');
      IF (NOT SysPrtd) THEN Dbms_Output.Put_Line('-- You need to run as SYS: '); SysPrtd := TRUE; END IF;
      Dbms_Output.Put_Line('grant select any table to '||USER||';');
      Dbms_Output.New_Line();
      RaiseError := true;
    end if;
  else -- 9i or 10g
    select count(*) into NrFound from user_sys_privs where privilege in ('SELECT ANY DICTIONARY');
    if (NrFound = 0 AND USER <> 'SYS') then
      Dbms_Output.Put_Line('-- This user requires access to a lot of data dictionary tables');
      IF (NOT SysPrtd) THEN Dbms_Output.Put_Line('-- You need to run as SYS: '); SysPrtd := TRUE; END IF;
      Dbms_Output.Put_Line('grant select any dictionary to '||USER||';');
      Dbms_Output.New_Line();
      RaiseError := true;
    end if;
  end if;
  if (RaiseError) then
    Dbms_Output.Put_Line('-- After doing all this, run this setup script again as user '||USER);
    Dbms_Output.New_Line();
    Dbms_Output.Put_Line('================================================================================');
    Dbms_Output.Put_Line('==       PREREQUISITES NOT OK, FURTHER INSTRUCTIONS ARE DISPLAYED ABOVE       ==');
    Dbms_Output.Put_Line('================================================================================');
    Dbms_Output.New_Line();
    Raise_Application_Error(-20999,'Follow the instructions above, then run the setup script again.');
  end if;
END;
