1<b>About this package</b>:
1About this package:
1------------------:
1Script developed and copyrighted by Geert De Paep, Belgium.:
1This package is intended for Oracle 8.1.7 and higher.:
1It uses only selects, no ins/upd/del, create, alter, drop or truncate,:
1except the Tuning module, which inserts into the temporary table PLATO$GDP_TE+
1MP:
1You may be able to run it in 8.1.5 or 8.1.6 if you first create the htp :
1package (specification only) that comes with the mod_plsql of Oracle 8.1.7 an+
1d higher:
1Any use of this script is at your own risk.:
1This program is free software:: you can redistribute it but you cannot sell i+
1t.:
1Contact me on http:://www.dba-village.com for tips, suggestions and remarks.:
