1<b>And ...</b>:
1And ...:
1-------:
1* The very first original version 1 dates from somewhere in 1997.:
1* One of the goals of this package was to be completely read-only, so it can +
1safely be run in a production database. :
1For performance reasons and efficiency, one exception has been made, being th+
1e global temporary PLATO$GDP_TEMP table.:
1* This package has never had the intention of replacing statspack. :
1This package gives a lof of ad-hoc information about the current state of the+
1 database. :
1Statspack gives you more historical information about performance statistics.:
1* The todo-list is still very long...:
