1 Usage:::
1 ------:
1  Local HTML file:::
1    Open DOS or unix prompt:
1    sqlplus "sys@<DbAlias> as sysdba":
1    SQL> set serveroutput on:
1    SQL> spool report.htm:
1    SQL> exec plato.audit('HTM');:
1    SQL> spool off:
1    SQL> exit:
1  Ascii mode:::
1    SQL> set serveroutput on format wrapped:
1    SQL> set lines 1000 trimspool on feed off:
1    SQL> spool report.txt:
1    SQL> exec plato.audit('TXT');:
1    Note:: do "exec plato.env" to remember SQL*Plus settings:
1  Mod_plsql:::
1    Configure DAD:
1    http:://host::port/pls/DAD/plato.audit?FormatA=HTP:
1  Others:::
1    plato.Help('HTM');:
1    plato.About('HTM');:
1    plato.Footprint('HTM');:
1    plato.Storage('HTM');:
1    plato.SystemState('HTM');:
1    plato.Tuning('HTM',30); ("30":: run for 30 seconds):
1    plato.SessionDetails('HTM',<SessionId>);:
1    plato.ProcessDetails('HTM',<Spid>);:
1    plato.Complete('HTM');:
